import Head from 'next/head';

function Home(){
    return (
        <div>
            <Head>
                <title>Fale Mais</title>
                <meta name='robots' content='index/follow' />
                <meta name='description' content='Site da Vizir sobre o Fale Mais' />
            </Head>
        </div>
    );
};

export default Home;
